import React from "react";

//import Todo from "./Todo.js"

function TodoList({todo,text}){
    return(
        <div>

        <ol class="notCompleted">
			<h3>NOT COMPLETED</h3>
            <li>{todo}</li>
                <button>done</button>
                <button>delete</button>
		</ol>

		<ol class="Completed">
			<h3>COMPLETED</h3>
            <li>hey</li>
                <button>delete</button>
		</ol>
    </div>
    )
}
export default TodoList;
